import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the listings to load
    await page.waitForSelector('.listing-rating');

    // Extract listings with ratings 4.8 and above
    const listings = await page.evaluate(() => {
      const results = [];
      const elements = document.querySelectorAll('.listing-rating');
      elements.forEach(element => {
        const rating = parseFloat(element.innerText);
        if (rating >= 4.8) {
          const id = element.closest('.listing-item').getAttribute('data-id'); // Assuming there's a data-id attribute
          results.push({ id, rating });
        }
      });
      return results;
    });

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_extraction.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_extraction.png'));

    return {
      success: true,
      action: "Extracted listings with ratings 4.8 and above",
      extractedData: listings,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

